import React from 'react';

export default function RecordList(props) {

    let tableType = props.type;
    let retrievedList = null;

    //If the desired table format is 'list', form the table as a basic list
    if (tableType === "list") {
        retrievedList = createListTable();

        return (
            React.createElement('tbody', {}, retrievedList)
        );
    }

    //Else, form the table using record cover images
    else {
        retrievedList = createImageTable();
        return (
            React.createElement('div', {id: "recordImageTable"}, retrievedList)
        );
    }
}


/* Name: createImageTable
 * Description: This function creates a flexbox table of all of the records passed with record cover images.
 *
 * 
*/ 
function createImageTable() {
    let divCount = 0;

    let recordList = [];

    records.forEach(record => {
        divCount++;

        let newDiv = React.createElement('div', {className: "recordDiv", key:divCount}, 
            [
                React.createElement('img', {src: record.image, key: "image" + divCount}),
                React.createElement('p', {key: "artist" + divCount}, record.artist),
                React.createElement('p', {key: "title" + divCount}, record.title)
            ]
        );

        recordList.push(newDiv);
    }); 

    return recordList;
}



/* Name: createListTable
 * Description: This function creates a list formatted table of all of the records passed without record cover images.
 *
 * No parameters
 * Return: A tbody containing every record as a table row.
*/ 
function createListTable() {

    let rowCount = 0;

    let recordList = [];

    records.forEach(record => {
        rowCount++;

        //Create a new table row
        let newRow = React.createElement('tr', {key:rowCount}, 
            [
                React.createElement('td', {className:"artistCol", key:"artist" + rowCount}, record.artist),
                React.createElement('td', {className:"titleCol", key:"title" + rowCount}, record.title),
                React.createElement('td', {className:"yearCol", key:"year" + rowCount}, record.year),
                React.createElement('td', {className:"numCol", key:"num" + rowCount}, record.quantity)
            ]
        );
        recordList.push(newRow);
    });

    return recordList;
}

